import React, { useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import api from '../../services/api';

export default function NovoTutor() {
  const navigate = useNavigate();

  const [formData, setFormData] = useState({
    nome: '',
    telefone: '',
    email: '',
    cpf: '',
    endereco: '',
    dataNascimento: ''
  });

  const [formErrors, setFormErrors] = useState({});

  const formatarCPF = (valor) => {
    return valor
      .replace(/\D/g, '')
      .replace(/(\d{3})(\d)/, '$1.$2')
      .replace(/(\d{3})(\d)/, '$1.$2')
      .replace(/(\d{3})(\d{1,2})$/, '$1-$2');
  };

  const formatarTelefone = (valor) => {
    return valor
      .replace(/\D/g, '')
      .replace(/(\d{2})(\d)/, '($1) $2')
      .replace(/(\d{5})(\d)/, '$1-$2')
      .replace(/(-\d{4})\d+?$/, '$1');
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    let val = value;
    if (name === 'cpf') val = formatarCPF(value);
    if (name === 'telefone') val = formatarTelefone(value);
    setFormData({ ...formData, [name]: val });
  };

  const validate = () => {
    const errors = {};
    const cpfNumerico = formData.cpf.replace(/\D/g, '');
    const telNumerico = formData.telefone.replace(/\D/g, '');

    if (!formData.nome.trim()) errors.nome = 'Nome é obrigatório';
    if (!telNumerico || telNumerico.length < 10 || telNumerico.length > 11) {
      errors.telefone = 'Telefone é obrigatório e deve conter DDD + número';
    }
    if (!formData.email.trim() || !formData.email.includes('@')) {
      errors.email = 'Email inválido';
    }
    if (!cpfNumerico || cpfNumerico.length !== 11) {
      errors.cpf = 'CPF deve ter 11 dígitos';
    }
    if (!formData.endereco.trim()) errors.endereco = 'Endereço é obrigatório';
    if (!formData.dataNascimento) {
      errors.dataNascimento = 'Data de nascimento inválida (formato ISO)';
    }

    return errors;
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const errors = validate();
    setFormErrors(errors);

    if (Object.keys(errors).length === 0) {
      api.post('/tutores', formData)
        .then(() => navigate('/tutores'))
        .catch(err => console.error('Erro ao cadastrar tutor:', err));
    }
  };

  return (
    <div className="container my-5">
      <div className="d-flex justify-content-between align-items-center mb-4">
        <h2>Cadastrar Novo Tutor</h2>
        <div>
          <Link to="/" className="btn btn-outline-secondary me-2">Voltar ao Início</Link>
          <Link to="/tutores" className="btn btn-secondary">Ver Tutores</Link>
        </div>
      </div>

      <form onSubmit={handleSubmit}>
        <div className="mb-3">
          <label className="form-label">Nome</label>
          <input name="nome" className="form-control" value={formData.nome} onChange={handleChange} />
          {formErrors.nome && <div className="text-danger">{formErrors.nome}</div>}
        </div>
        <div className="mb-3">
          <label className="form-label">Telefone</label>
          <input name="telefone" className="form-control" value={formData.telefone} onChange={handleChange} />
          {formErrors.telefone && <div className="text-danger">{formErrors.telefone}</div>}
        </div>
        <div className="mb-3">
          <label className="form-label">Email</label>
          <input name="email" type="email" className="form-control" value={formData.email} onChange={handleChange} />
          {formErrors.email && <div className="text-danger">{formErrors.email}</div>}
        </div>
        <div className="mb-3">
          <label className="form-label">CPF</label>
          <input name="cpf" className="form-control" value={formData.cpf} onChange={handleChange} />
          {formErrors.cpf && <div className="text-danger">{formErrors.cpf}</div>}
        </div>
        <div className="mb-3">
          <label className="form-label">Endereço</label>
          <input name="endereco" className="form-control" value={formData.endereco} onChange={handleChange} />
          {formErrors.endereco && <div className="text-danger">{formErrors.endereco}</div>}
        </div>
        <div className="mb-3">
          <label className="form-label">Data de Nascimento</label>
          <input name="dataNascimento" type="date" className="form-control" value={formData.dataNascimento} onChange={handleChange} />
          {formErrors.dataNascimento && <div className="text-danger">{formErrors.dataNascimento}</div>}
        </div>
        <button type="submit" className="btn btn-success">Cadastrar Tutor</button>
      </form>
    </div>
  );
}
